import { useEffect } from "react";
import react from "react";
import { Link } from "react-router-dom";
import { Card } from "reactstrap";
import ProjectPreview from "./ProjectPreview";

interface Props {
  id?: number;
}

const MyProjects: react.FC = () => {
  return (
    <div className="work__projects" onClick={ScrollToTop()}>
      <div className="work__projects-listitem">
        <Link to="/medicol">
          <img src="/img/myprojects/uikitmedicol/1.png" alt="" />
          <div className="work__projects-listitem--content">
            <h1>Medicol mobile UI kit</h1>
            <Card className="work__projects-listitem--content-divider"></Card>
            <p>UI/UX designer</p>
          </div>
        </Link>
      </div>
      <ProjectPreview
        imagepath="/img/myprojects/uikitmedicol/1.png"
        title="Medicol mobile UI kit"
        role="UI/UX designer"
      ></ProjectPreview>
      <Link to="/medicol">
        <img src="/img/myprojects/uikitmedicol/1.png" alt="" />
      </Link>
      <Link to="/medecinQuiz">
        <img src="/img/myprojects/medecinquiz/1.png" alt="" />
      </Link>
      <Link to="/smarttrans">
        <img src="/img/myprojects/smarttrans/1.png" alt="" />
      </Link>
      <Link to="/saidetudes">
        <img src="/img/myprojects/saidetudes/1.png" alt="" />
      </Link>
      <Link to="/socialmediaapp">
        <img src="/img/myprojects/socialmediaapp/1.png" alt="" />{" "}
      </Link>
      <Link to="/beachsnowvolleyball">
        <img src="/img/myprojects/beachsnowvolleyball/1.png" alt="" />
      </Link>
      <Link to="/gamingpackagewebsite">
        <img src="/img/myprojects/gamespackages/1.png" alt="" />
      </Link>
    </div>
  );
};

export default MyProjects;

const ScrollToTop: any = () => {
  useEffect(() => {
    window.scrollTo(0, 0);
  }, []);
};
